insert into disc.main_factor_description (factor, title, description, positive_points, improvement_points, keywords) values ('D', 'Dominância', 'São pessoas competitivas e determinadas, voltadas a atingir objetivos e a atuar com foco em entregas e resultados. Exigentes, racionais, com tendência a comportamentos autoritários, podem querer controlar e dominar tudo a sua volta. Geralmente, se comunicam de forma direta e franca, não pensam muito antes de falar, chegam a interromper os outros. Gostam de desafios e lidam melhor com tarefas do que com pessoas. São motivados por liberdade, autonomia, autoridade, crescimento e desafios. Podem passar a impressão de um perfil corajoso, imparável e obstinado; por outro lado, podem parecer arrogantes, argumentativos e agressivos.', 'Grande capacidade de iniciar coisas, foco em resultados e metas, competividade, capacidade para lidar com grandes desafios.', 'Dificuldade para ouvir, impaciência, excesso de controle e de debates, autoritarismo, pouco planejamento.', 'Aventura; Competição; Iniciativa; Determinação; Agressividade; Objetividade; Impaciência.');
insert into disc.main_factor_description (factor, title, description, positive_points, improvement_points, keywords) values ('I', 'Influência', 'São pessoas comunicativas e extrovertidas, voltadas à interação. Possuem grande facilidade para conhecer pessoas e ampliar a sua rede de contatos. Costumam se comunicar de forma alegre, são persuasivas e convincentes, ou seja. possuem facilidade para vender suas ideias. Gostam de lidar com pessoas e são motivadas por reconhecimento social e popularidade, sendo assim, preferem um ambiente de trabalho descontraído e leve. Podem passar a impressão de um perfil divertido, informal, popular; por outra lado, podem parecer superficiais, exagerados e até prolixos.', 'Criatividade, motivação de pessoas, trabalho em equipe, negociação, persuasão, bom humor.', 'Impulsividade, sentimentalismo, falta de atenção a detalhes, excesso de expressões faciais, falar demais, pouco planejamento.', 'Acolhimento; Calma; Cooperação; Consistência; Possessividade; Previsibilidade; Sistematização.');
insert into disc.main_factor_description (factor, title, description, positive_points, improvement_points, keywords) values ('S', 'Estabilidade', 'São pessoas tranquilas, com habilidade para ouvir e pensar antes de falar, são cooperativas e termimam o que começam. Possuem tendência à cautela, por isso, precisam de mais tempo do que os demais para concluir tarefas. Costumam se comunicar de forma indireta. educada, cordial e atenciosa. Gostam de pessoas e de estabilidade. Suas relações profissionais ou pessoais são de longa duração. São motivados por harmonia, identificação com o ambiente e com as pessoas, procedimentos estruturados, e valorização do seu compromisso e lealdade. Podem passar a impressão de calma e serenidade; por outro lado, podem parecer instrospectivos e resistentes a mudanças.', 'rabalho em equipe,  dedicação a uma causa ou liderança, paciência para atuar em situações complexas, terminar o que começa, saber ouvir.', 'Resistência a mudanças, pouca iniciativa, tensão para lidar com críticas, baixo senso de urgência, autonomia limitada.', 'Acolhimento; Calma; Cooperação; Consistência; Possessividade; Previsibilidade; Sistematização.');
insert into disc.main_factor_description (factor, title, description, positive_points, improvement_points, keywords) values ('C', 'Conformidade', 'São pessoas altamente voltadas a detalhes, precisão e qualidade, com forte tendência a exigir demais tanto de si, quanto dos outros. Buscam a perfeição e, por isso, tendem a focar demais no que pode dar errado. Tendem a um perfil mais instrospectivo e costumam se comunicar de forma direta e objetiva. No entanto, podem ser detalhistas ao falar de aspectos relacionados a procedimentos ou direcionamentos. Gostam de ambientes com normas e regras claras, e preferem atuar com tarefas do que com pessoas. São motivados por procedimentos estruturados, qualidade, tempo para pensar e agir, e acesso a informações. Podem ser vistos como pessoas preocupadas e pessismistas;  por outro lado, passam a impressão de indivíduos focados, estudiosos e cheios de conteúdo.', 'Pensamento crítico, altos padrões de qualidade, foco, cuidado e atenção a detalhes.', 'Analisar demais, excesso de críticas, exigência e preocupação, perfil retraído.', 'Análise; Cautela; Conformidade; Qualidade; Formalidade; Instrospecção; Exigência.');
